script: |
  super -f text -I q5524.spq | sort > q5524.out

inputs:
  - name: q5524.spq
    data: |
      SELECT + col0 + + col0 FROM tab2 (FORMAT parquet) WHERE + 37 NOT BETWEEN + - col0 * + + ( - col0 ) * + 30 AND - col2 * - 79 + - - col2 + + col1;
  - name: tab2

outputs:
  - name: q5524.out
    data: |
      128
      150
      92
